package main

import (
    "strings"
)

// ReverseDelete removes characters from s that are in c, 
// then checks if the resulting string is a palindrome.
func ReverseDelete(s, c string) [2]interface{} {
    // Create a map for characters to remove for faster lookups
    charMap := make(map[rune]struct{})
    for _, char := range c {
        charMap[char] = struct{}{}
    }

    // Build a new string without the characters in charMap
    var result strings.Builder
    for _, char := range s {
        if _, found := charMap[char]; !found {
            result.WriteRune(char)
        }
    }

    // Check if the resulting string is a palindrome
    resultStr := result.String()
    isPalindrome := isPalindromic(resultStr)

    return [2]interface{}{resultStr, isPalindrome}
}

// isPalindromic checks if a string is a palindrome
func isPalindromic(s string) bool {
    left, right := 0, len(s)-1
    for left < right {
        if s[left] != s[right] {
            return false
        }
        left++
        right--
    }
    return true
}
